import React, {useEffect} from 'react'
import axios from 'axios'

export const getProduct = () => {
    const products = [];
    const url = 'https://yalantis-react-school-api.yalantis.com/api/v1/products';
    axios.get(url)
        .then((result) => result.json())
        .then((result) => {
            products = result.items
        })
    return products;
}
